import React from "react";
import { View, Text, Image, TextInput, TouchableOpacity, FlatList } from "react-native";
import { Ionicons, FontAwesome, AntDesign, MaterialIcons, } from "@expo/vector-icons";
import { render } from "react-dom";


export default function Cart(params){
    const navigation = params.navigation;
    return(
        <View style ={{backgroundColor: "white", flex: 1,}}>
            <View
            style={{
              flexDirection: "row",
              justifyContent: "space-between",
              backgroundColor: "#000099",
              alignItems: "center",
              paddingTop: 15,
              paddingBottom: 10,
              paddingHorizontal: 15,
            }}
          >
            <Ionicons name="arrow-back-outline" size={24} color="white" />
            <Text style={{color: "white", fontWeight: "bold", fontSize: 16}}>CART</Text>
            <View style={{ flexDirection: "row", justifyContent: "space-between"}}>
            </View>
            </View>

            <View style={{ padding: 15}}>
        <TouchableOpacity
          onPress={() => {
            navigation.navigate("Cart");
          }}
          style={{
            //padding: 10,
            height: 130,
            width: 340,
            //paddingRight: 25,
            //marginTop: 2,
            marginBottom: 10,
            alignItems: "center",
            borderRadius: 5,
            flexDirection: "row",
            // borderColor: "#000099",
            borderWidth: 1,
            borderColor: "#e0e0e0",
          }}
        >
          <Image
          style={{
            //borderRadius: 20,
            //marginBottom: 60,
            width: 100,
            height: 100,
            borderRadius: 5,
            marginLeft: 10,
            borderColor: "#000099",
            borderWidth: 1,
          }}
          source={{
            uri: "https://dhabione.com/wp-content/uploads/2020/01/qw.jpg",
          }}
        />
        <View style={{paddingLeft: 30, }}>
          <Text style = {{color: "#black", fontWeight: "500", fontSize: 16, }}>Single Seater Sofa</Text>
          <Text style = {{color: "#000099"}}>GHC 1,200.00</Text>
          <View style={{flexDirection: "row"}}>
          <View style={{backgroundColor: "#e0e0e0", height:24, width: 24, borderRadius:24, justifyContent: "center", alignItems: "center",}}>
              <Text style={{color: "black", fontSize:  24, justifyContent: "center", alignItems: "center"}}>-</Text>           
          </View>
          <Text style={{color: "black", fontSize:  24, justifyContent: "center", alignItems: "center"}}>1</Text>
        </View>
        </View>
        </TouchableOpacity>
        </View>
        </View>
    )
}
